import Button from './Button'

const Header = ({title, onAdd}) => {
  return (
    <header className='header'>
        <h1>{props.title}</h1>
        <Button title="Add" color="green" onClick={()=>props.onAdd}/>
        <Button title="Remove" color="red"/>
        <Button title="Edit"/>
    </header>
  )
}

export default Header
